import React, { Component } from 'react';
import Slider from 'react-input-slider';
class PersonsCount extends Component {
    state = {
        x:10,
    }
    handleChange =()=>{
        this.setState({
            x: this.state+1
        })
    }

    render() {
        return(
            <div>

                <Slider axis="x" x={this.state.x}/>
                ({this.state.x})
          </div>
        )
    }
}

export default PersonsCount;
